// import cart_video from "../assets/cart.mp4"

const BackgroundVideo = () => (
  <video autoPlay="autoplay" loop="loop" muted>
    <source src="../assets/cart.mp4" type="video/mpeg"/>
  </video>
);

export default BackgroundVideo;
